import '../App.css';
import React from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";

const Home = () => {

    const navigate = useNavigate();

    const handlePull = () => {
        navigate("/Pull");
    };

    const handleShow = () => {
        navigate("/Show");
    };

    return (
        <div className="Containner-home">
                <p className='Text-Welcome'>WELCOME</p>
            {/* <div className='Div-butcon'>
                    <button
                        className='Button-styleCon'
                        onClick={handlePull}
                    >
                    Pull images
                    </button>
                    <button
                        className='Button-styleCon'
                        onClick={handleShow}
                    >
                    Show images
                    </button>
            </div> */}
            <div style={{display: 'flex', flex: '1' , flexDirection: 'row', justifyContent: 'center', alignItems: 'center'}}>
            <div className='Box-PS' style={{marginRight: '50px'}}>
            <div className='Circle'></div>
            </div>
            <div className='Box-PS'>
            <div className='Circle'></div>
            </div>
            </div>
        </div>
    );
};

export default Home;
